        <thead>
            <tr>
                <th>#</th>
                <th>Имя</th>
                <th>Фамилия</th>
                <th>Баллы скоринга</th>
                <th>Действие</th>
            </tr>
        </thead>
        <tbody>
        {% for user in pagination %}
            <tr>
                <td>{{ user.id }}</td>
                <td>{{ user.firstName }}</td>
                <td>{{ user.lastName }}</td>
                <td>{{ user.scoring }}</td>
                <td>
                    <a class=\"btn btn-warning\" href=\"{{ path('app_users_show', {'id': user.id}) }}\">Изменить</a><br>
                    {{ include('users/_delete_form.html.twig') }}
                </td>
            </tr>
